import React from 'react';

const Products=()=>{
    const products=["Learning React", "Pro React", "Beginning React"];
    const listProducts=products.map((product)=>
    <li key={product.toString()}>{product}</li>
    );

    return(
        <div>
            <ul>{listProducts}</ul>
        </div>
    );
    }

export default Products
